				dic = JSON.parse(dic);
				let keys = Object.keys(dic).sort();
				let list = Vue.ref([]);

				for (let i in keys) {
					let key = keys[i];
					list.value.push({ "key": key, "obj": dic[key] })
				}

				function changeSource() {
					dicNew = JSON.parse(dicNew);
					let keys = Object.keys(dicNew).sort();
					list.value = []

					for (let i in keys) {
						let key = keys[i];
						list.value.push({ "key": key, "obj": dicNew[key] })
					}
				}

				let copy = (item) => {
					console.log(item);
					let dic2 = item.obj;
					let keys = Object.keys(dic2);

					let input = document.createElement('input');
					input.type = 'text';
					input.value = dic2[keys[0]];
					document.body.appendChild(input);

					try {
						input.select();
						document.execCommand('copy');
						document.body.removeChild(input);
					} catch (error) {

					}
				}

				return {
					list,
					copy,
					changeSource
				}
			}
		}).mount("#app");
